import React from 'react';
export default class PaginaDeServicosDetalhados extends React.Component {
    render() {
        return (
            <>
                <section>
                    <h1>Busca de Serviços</h1>
                </section>
                <hr />
                <section>
                    <h1>Lista de Serviços</h1>
                </section>

            </>
        )
    }
}
